import React from 'react';

export function OfficesCard({ iconURL, title, address, city }) {

    return (
    <div className="row m-0">
        <div className="col-md-4 mb-2 w-80">
            <div className="d-flex flex-column bg-white rounded sw-rounded p-5 text-center position-relative">
                <figure className="mb-4">
                    <img src={iconURL} className="u-icon u-icon--lg u-icon-secondary--air rounded-circle" alt="office address"/>
                </figure>
                <h3 className="sw-heading-alt sw-heading-alt-2 mb-2">{title}</h3>
                <p className="mb-md-0">{address}</p>
                <p className="mb-md-0">{city}</p>
            </div>

        </div>
    </div>
    );
}
